const codeGenerator=e=>{switch(e.type){case"Program":return e.body.map(codeGenerator).join("\n");case"ExpressionStatement":return codeGenerator(e.expression)+";";case"CallExpression":return codeGenerator(e.callee)+"("+e.arguments.map(codeGenerator).join(",")+")";case"Identifier":return e.name;case"NumberLiteral":return e.value;case"StringLiteral":return'"'+e.value+'"';default:throw new TypeError(e.type)}};module.exports=codeGenerator;